import React from 'react';
import {Feature} from '../../components';
import './features.css';

const Features = () => {
    return (
        <div className="profile__features section__padding" id="features">
            <div className="profile__my__feature">
                <Feature/>
                <div className="profile__my__feature__heading">
                    <h1 className="gradient-text">HTML5</h1>
                </div>
            </div>

        </div>
    )
}

export default Features
